int main(void){
  cfact();
  long long i,j,n,m,k,a[32],b,c,h,w,r=0,l,t;
  long long dp[1024]={0},ndp[1024]={0};
  scanf("%lld%lld",&n,&k);
  for(i=0;i<k;i++){scanf("%lld",&a[i]);}
  dp[0]=1;
  for(i=0;i<k;i++){
    for(j=n;j>=0;j--){
      if(dp[j]==0){continue;}
      for(h=n;h>=j;h--){
        w=h-j;
        if(w>a[i]){continue;}
        t=calcnCr(n-j,w);
        t*=calcnCr(n-w,a[i]-w);t%=mod;
        ndp[h]+=dp[j]*t;ndp[h]%=mod;
      }
    }
    for(j=0;j<=n;j++){dp[j]=ndp[j];ndp[j]=0;}
  }
  printf("%lld\n",dp[n]);
  return 0;
}
